!-- wp:quote {\"align\":\"center\",\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote has-text-align-center is-style-large\"><p>\"Contribuire mi fa sentire di essere utile al pianeta.\"</p><cite>â Anna Wong, <em>Volontario</em></cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:separator {\"className\":\"is-style-default\"} -->\n<hr class=\"wp-block-separator is-style-default\" />\n<!-- /wp:separator -->\";}i:1;O:8:\"stdClass\":7:{s:2:\"id\";i:5920;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:30:\"Due colonne con testo e titolo\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:1520:\"\n<h2 style=\"font-size:38px;line-height:1.4\"><strong>Il viaggio era iniziato, ed era iniziato felicemente con un morbido cielo azzurro e un mare calmo.</strong></h2>\n\n\n\n<div class=\"is-layout-flex wp-container-3 wp-block-columns\">\n<div class=\"is-layout-flow wp-block-column\">\n<p style=\"font-size:18px\">La seguirono sul ponte. Tutto il fumo e le case erano scomparsi, e la nave era fuori in un ampio spazio di mare molto fresco e limpido sebbene pallido nella prima luce. Avevano lasciato Londra seduta sul suo fango. Una linea d&#8217;ombra sottilissima si assottigliava all&#8217;orizzonte, appena abbastanza spessa da sopportare il peso di Parigi, che tuttavia vi gravava sopra. Erano liberi da strade, liberi dall&#8217;umanitÃ , e la stessa euforia per la loro libertÃ  li attraversava tutti.</p>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\">\n<p style=\"font-size:18px\">La nave si stava facendo strada costantemente attraverso piccole onde che la schiaffeggiavano e poi sfrigolavano come acqua effervescente, lasciando un piccolo bordo di bolle e schiuma su entrambi i lati. L&#8217;incolore cielo di ottobre era appena coperto da nuvole, come da una scia di fumo di legna, e l&#8217;aria era meravigliosamente salata e frizzante. In effetti faceva troppo freddo per stare fermi. La signora Ambrose strinse il braccio in quello del marito, e mentre si allontanavano si poteva vedere dal modo in cui la sua guancia inclinata si avvicinava alla sua che aveva qualcosa di privato da comunicare.</p>\n</div>\n</div>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{s:10:\"spay_email\";s:0:\"\";s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:57:\"Due colonne di testo precedute da una lunga intestazione.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:0:{}s:11:\"wpop_locale\";s:5:\"it_IT\";}s:14:\"category_slugs\";a:2:{i:0;s:7:\"columns\";i:1;s:4:\"text\";}s:13:\"keyword_slugs\";a:1:{i:0;s:4:\"core\";}s:15:\"pattern_content\";s:1810:\"<!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":38,\"lineHeight\":\"1.4\"}}} -->\n<h2 style=\"font-size:38px;line-height:1.4\"><strong>Il viaggio era iniziato, ed era iniziato felicemente con un morbido cielo azzurro e un mare calmo.</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":18}}} -->\n<p style=\"font-size:18px\">La seguirono sul ponte. Tutto il fumo e le case erano scomparsi, e la nave era fuori in un ampio spazio di mare molto fresco e limpido sebbene pallido nella prima luce. Avevano lasciato Londra seduta sul suo fango. Una linea d\'ombra sottilissima si assottigliava all\'orizzonte, appena abbastanza spessa da sopportare il peso di Parigi, che tuttavia vi gravava sopra. Erano liberi da strade, liberi dall\'umanitÃ , e la stessa euforia per la loro libertÃ  li attraversava tutti.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":18}}} -->\n<p style=\"font-size:18px\">La nave si stava facendo strada costantemente attraverso piccole onde che la schiaffeggiavano e poi sfrigolavano come acqua effervescente, lasciando un piccolo bordo di bolle e schiuma su entrambi i lati. L\'incolore cielo di ottobre era appena coperto da nuvole, come da una scia di fumo di legna, e l\'aria era meravigliosamente salata e frizzante. In effetti faceva troppo freddo per stare fermi. La signora Ambrose strinse il braccio in quello del marito, e mentre si allontanavano si poteva vedere dal modo in cui la sua guancia inclinata si avvicinava alla sua che aveva qualcosa di privato da comunicare.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\";}i:2;O:8:\"stdClass\":7:{s:2:\"id\";i:8229;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:46:\"Due colonne di testo con intestazione sfalsata\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:2064:\"\n<div class=\"is-layout-flow wp-block-group alignfull has-background\" style=\"background-color:#f2f0e9\">\n<div style=\"height:70px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<div class=\"is-layout-flex wp-container-6 wp-block-columns alignwide are-vertically-aligned-center\">\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:50%\">\n<p class=\"has-text-color\" style=\"color:#000000;font-size:30px;line-height:1.1\"><strong>Ispirazione Oceanica</strong></p>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:50%\">\n<hr class=\"wp-block-separator has-text-color has-background is-style-wide\" style=\"background-color:#000000;color:#000000\" />\n</div>\n</div>\n\n\n\n<div class=\"is-layout-flex wp-container-10 wp-block-columns alignwide\">\n<div class=\"is-layout-flow wp-block-column\"></div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Avvolgendosi i veli intorno al capo, le donne camminavano sul ponte. Ora si stavano muovendo con regolaritÃ  lungo il fiume, superando le sagome scure delle navi all&#8217;ancora, e Londra era uno sciame di luci con un baldacchino giallo pallido che pendeva sopra di esso. C&#8217;erano le luci dei grandi teatri, le luci delle lunghe strade, luci che indicavano grandi piazze di comoditÃ  domestica, luci che pendevano alte nell&#8217;aria.</p>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Nessuna oscuritÃ  si sarebbe mai posata su quelle lampade, come nessuna oscuritÃ  si era posata su di loro per centinaia di anni. Sembrava terribile che la cittÃ  ardesse per sempre nello stesso punto; terribile almeno per chi parte per l&#8217;avventura sul mare e lo vede come un tumulo circoscritto, eternamente bruciato, eternamente sfregiato. Dal ponte della nave la grande cittÃ  apparve una figura accovacciata e codarda, un avaro sedentario.</p>\n</div>\n</div>\n\n\n\n<div style=\"height:40px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n</div>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{s:10:\"spay_email\";s:0:\"\";s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:50:\"Due colonne di testo con un\'intestazione sfalsata.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:0:{}s:11:\"wpop_locale\";s:5:\"it_IT\";}s:14:\"category_slugs\";a:2:{i:0;s:7:\"columns\";i:1;s:4:\"text\";}s:13:\"keyword_slugs\";a:1:{i:0;s:4:\"core\";}s:15:\"pattern_content\";s:2889:\"<!-- wp:group {\"align\":\"full\",\"style\":{\"color\":{\"background\":\"#f2f0e9\"}}} -->\n<div class=\"wp-block-group alignfull has-background\" style=\"background-color:#f2f0e9\"><!-- wp:spacer {\"height\":70} -->\n<div style=\"height:70px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"verticalAlignment\":\"center\",\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide are-vertically-aligned-center\"><!-- wp:column {\"width\":\"50%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:50%\"><!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.1\",\"fontSize\":\"30px\"},\"color\":{\"text\":\"#000000\"}}} -->\n<p class=\"has-text-color\" style=\"color:#000000;font-size:30px;line-height:1.1\"><strong>Ispirazione Oceanica</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"50%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:50%\"><!-- wp:separator {\"customColor\":\"#000000\",\"className\":\"is-style-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-background is-style-wide\" style=\"background-color:#000000;color:#000000\" />\n<!-- /wp:separator --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#000000\"}},\"fontSize\":\"extra-small\"} -->\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Avvolgendosi i veli intorno al capo, le donne camminavano sul ponte. Ora si stavano muovendo con regolaritÃ  lungo il fiume, superando le sagome scure delle navi all\'ancora, e Londra era uno sciame di luci con un baldacchino giallo pallido che pendeva sopra di esso. C\'erano le luci dei grandi teatri, le luci delle lunghe strade, luci che indicavano grandi piazze di comoditÃ  domestica, luci che pendevano alte nell\'aria.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#000000\"}},\"fontSize\":\"extra-small\"} -->\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Nessuna oscuritÃ  si sarebbe mai posata su quelle lampade, come nessuna oscuritÃ  si era posata su di loro per centinaia di anni. Sembrava terribile che la cittÃ  ardesse per sempre nello stesso punto; terribile almeno per chi parte per l\'avventura sul mare e lo vede come un tumulo circoscritto, eternamente bruciato, eternamente sfregiato. Dal ponte della nave la grande cittÃ  apparve una figura accovacciata e codarda, un avaro sedentario.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":40} -->\n<div style=\"height:40px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";}i:3;O:8:\"stdClass\":7:{s:2:\"id\";i:3836;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:23:\"Due immagini affiancate\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:723:\"\n<figure class=\"is-layout-flex wp-block-gallery-12 wp-block-gallery alignwide columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img decoding=\"async\" src=\"https://s.w.org/images/core/5.8/nature-above-01.jpg\" alt=\"Vista aerea di onde che si infrangono sulla spiaggia.\" data-full-url=\"https://s.w.org/images/core/5.8/nature-above-01.jpg\" data-link=\"#\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img decoding=\"async\" src=\"https://s.w.org/images/core/5.8/nature-above-02.jpg\" alt=\"Vista aerea di un campo. Una strada attraversa l\'angolo superiore destro.\" data-full-url=\"https://s.w.org/images/core/5.8/nature-above-02.jpg\" data-link=\"#\" /></figure></li></ul></figure>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{s:10:\"spay_email\";s:0:\"\";s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:53:\"Una galleria di immagini con due immagini di esempio.\";s:19:\"wpop_viewport_width\";i:800;s:16:\"wpop_block_types\";a:0:{}s:11:\"wpop_locale\";s:5:\"it_IT\";}s:14:\"category_slugs\";a:1:{i:0;s:7:\"gallery\";}s:13:\"keyword_slugs\";a:1:{i:0;s:4:\"core\";}s:15:\"pattern_content\";s:744:\"<!-- wp:gallery {\"ids\":[null,null],\"linkTo\":\"none\",\"align\":\"wide\"} -->\n<figure class=\"wp-block-gallery alignwide columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://s.w.org/images/core/5.8/nature-above-01.jpg\" alt=\"Vista aerea di onde che si infrangono sulla spiaggia.\" data-full-url=\"https://s.w.org/images/core/5.8/nature-above-01.jpg\" data-link=\"#\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://s.w.org/images/core/5.8/nature-above-02.jpg\" alt=\"Vista aerea di un campo. Una strada attraversa l\'angolo superiore destro.\" data-full-url=\"https://s.w.org/images/core/5.8/nature-above-02.jpg\" data-link=\"#\" /></figure></li></ul></figure>\n<!-- /wp:gallery -->\";}i:4;O:8:\"stdClass\":7:{s:2:\"id\";i:6001;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:38:\"Header grande con testo ed un pulsante\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:1107:\"\n<div class=\"wp-block-cover alignfull has-background-dim-40 has-background-dim has-parallax\" style=\"background-image:url(https://s.w.org/images/core/5.8/art-01.jpg);background-color:#000000;min-height:100vh\"><div class=\"wp-block-cover__inner-container\">\n<h2 class=\"alignwide has-white-color has-text-color\" style=\"font-size:48px;line-height:1.2\"><strong><em>Oltremare:</em></strong><br><strong><em>1500 â 1960</em></strong></h2>\n\n\n\n<div class=\"is-layout-flex wp-container-17 wp-block-columns alignwide\">\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:60%\">\n<p class=\"has-text-color\" style=\"color:#ffffff\">Una mostra sulle diverse rappresentazioni dell&#8217;oceano nel tempo, tra Cinquecento e Novecento. Si svolge nella nostra Open Room al <em>Piano 2</em>.</p>\n\n\n\n<div class=\"is-layout-flex wp-block-buttons\">\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link has-text-color has-background no-border-radius\" style=\"background-color:#000000;color:#ffffff\">Visita</a></div>\n</div>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\"></div>\n</div>\n</div></div>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{