Texas.</p>\n\n\n\n<div class=\"is-layout-flex wp-block-buttons\">\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link\">Approfondisci</a></div>\n</div>\n</div></div>\n</div></div>\n\";s:9:\"protected\";b:0;}s:4:\"meta\";O:8:\"stdClass\":6:{s:10:\"spay_email\";s:0:\"\";s:13:\"wpop_keywords\";s:0:\"\";s:16:\"wpop_description\";s:87:\"Media e un blocco di testo con immagine sulla sinistra e testo e pulsante sulla destra.\";s:19:\"wpop_viewport_width\";i:1200;s:16:\"wpop_block_types\";a:0:{}s:11:\"wpop_locale\";s:5:\"it_IT\";}s:14:\"category_slugs\";a:1:{i:0;s:6:\"header\";}s:13:\"keyword_slugs\";a:1:{i:0;s:4:\"core\";}s:15:\"pattern_content\";s:1927:\"<!-- wp:cover {\"customOverlayColor\":\"#ffffff\",\"minHeight\":100,\"minHeightUnit\":\"vh\",\"contentPosition\":\"center center\",\"align\":\"full\"} -->\n<div class=\"wp-block-cover alignfull has-background-dim\" style=\"background-color:#ffffff;min-height:100vh\"><div class=\"wp-block-cover__inner-container\"><!-- wp:media-text {\"mediaLink\":\"https://s.w.org/images/core/5.8/soil.jpg\",\"mediaType\":\"image\",\"mediaWidth\":56,\"verticalAlignment\":\"center\",\"imageFill\":true} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-vertically-aligned-center is-image-fill\" style=\"grid-template-columns:56% auto\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(https://s.w.org/images/core/5.8/soil.jpg);background-position:50% 50%\"><img src=\"https://s.w.org/images/core/5.8/soil.jpg\" alt=\"Primo piano di terreno secco e spaccato.\" /></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":\"32px\"},\"color\":{\"text\":\"#000000\"}}} -->\n<h2 class=\"has-text-color\" style=\"color:#000000;font-size:32px\"><strong>Qual Ã¨ il problema?</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"17px\"},\"color\":{\"text\":\"#000000\"}}} -->\n<p class=\"has-text-color\" style=\"color:#000000;font-size:17px\">Gli alberi sono oggi piÃ¹ importanti che mai. Secondo quanto riferito, piÃ¹ di 10.000 prodotti sono realizzati dagli alberi. Attraverso la chimica, l\'umile catasta di legna produce sostanze chimiche, plastica e tessuti che erano oltre ogni comprensione quando un\'ascia abbattÃ© per la prima volta un albero del Texas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"className\":\"is-style-fill\"} -->\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link\">Approfondisci</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div>\n<!-- /wp:media-text --></div></div>\n<!-- /wp:cover -->\";}i:10;O:8:\"stdClass\":7:{s:2:\"id\";i:5910;s:5:\"title\";O:8:\"stdClass\":1:{s:8:\"rendered\";s:32:\"Tre colonne con immagini e testo\";}s:7:\"content\";O:8:\"stdClass\":2:{s:8:\"rendered\";s:2971:\"\n<div class=\"is-layout-flow wp-block-group alignfull has-background\" style=\"background-color:#f8f4e4\">\n<div class=\"is-layout-flex wp-container-23 wp-block-columns alignwide\">\n<div class=\"is-layout-flow wp-block-column\">\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<h6 class=\"has-text-color\" id=\"ecosystem\" style=\"color:#000000\">ECOSISTEMA</h6>\n\n\n\n<p class=\"has-text-color\" style=\"color:#000000;font-size:5vw;line-height:1.1\"><strong>Crescita positiva.</strong></p>\n\n\n\n<div style=\"height:5px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n</div>\n</div>\n\n\n\n<div class=\"is-layout-flex wp-container-27 wp-block-columns alignwide\">\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:33.38%\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\"><em>Natura</em>, nel senso comune, si riferisce a essenze immutate dall&#8217;uomo; lo spazio, l&#8217;aria, il fiume, la foglia.&nbsp;<em>L&#8217;arte</em>&nbsp;si applica alla mescolanza della sua volontÃ  con le stesse cose, come in una casa, un canale, una statua, un quadro. Ma le sue operazioni prese insieme sono cosÃ¬ insignificanti, una piccola scheggiatura, cottura, rattoppatura e lavaggio, che in un&#8217;impressione cosÃ¬ grandiosa come quella del mondo sulla mente umana, non variano il risultato.</p>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:33%\">\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n\n\n\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://s.w.org/images/core/5.8/outside-01.jpg\" alt=\"Il sole che tramonta attraverso una fitta foresta di alberi.\" /></figure>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:33.62%\">\n<figure class=\"wp-block-image size-large\"><img decoding=\"async\" src=\"https://s.w.org/images/core/5.8/outside-02.jpg\" alt=\"Turbine eoliche in piedi su una pianura erbosa, con un cielo blu sullo sfondo.\" /></figure>\n</div>\n</div>\n\n\n\n<div class=\"is-layout-flex wp-container-30 wp-block-columns alignwide\">\n<div class=\"is-layout-flow wp-block-column\" style=\"flex-basis:67%\">\n<div class=\"wp-block-image\"><figure class=\"alignright size-large\"><img decoding=\"async\" src=\"https://s.w.org/images/core/5.8/outside-03.jpg\" alt=\"Il sole splende su un crinale che conduce alla costa. In lontananza, un\'auto scende lungo una strada.\" /></figure></div>\n</div>\n\n\n\n<div class=\"is-layout-flow wp-block-column is-vertically-aligned-center\" style=\"flex-basis:33%\">\n<p class=\"has-text-color has-extra-small-font-size\" style=\"color:#000000\">Indubbiamente non abbiamo domande da porre senza risposta. Dobbiamo fidarci della perfezione della creazione fino a questo punto, da credere che qualunque curiositÃ  l&#8217;ordine delle cose ha risvegliato nelle nostre menti, l&#8217;ordine delle cose puÃ² soddisfare. La condizione di ogni uomo Ã¨ una soluzione in geroglifico a quelle 